function convertToViewModel(n){var t=[];return Object.keys(n).map(function(i){var r={};r.date=new Date(i);r.isToday=(new Date).setHours(0,0,0,0)===r.date.setHours(0,0,0,0);r.isPast=(new Date).setHours(0,0,0,0)>r.date.setHours(0,0,0,0);r.people=n[i];t.push(r)}),t}$(document).ready(function(){var n={rota:{shifts:[]}};new Vue({el:"#rota",data:n});$.get("api/support/rota",function(t){n.rota.shifts=convertToViewModel(t.shifts)})});